import React, { Component } from 'react';
import 'bulma/css/bulma.min.css';
import { Route, Switch, withRouter } from 'react-router-dom';
import SignInForm from './components/SignInForm'


function App() {
  return (
      <Route path='/'>
        <div className="container">
        <SignInForm/>
